import React from 'react'
import s from "../../Users/Users.module.css";

let Paginator = ({TotalCount,pagesize,SetUserPage,currentPage,...props}) => {
    let page = []
    let colPages = Math.ceil(TotalCount / pagesize)
    for (let i = 1; i <= 50; i++) {
        page.push(i)
    }
    return (
        <div>
            {page.map(p =>
               <span onClick={() => SetUserPage(p)}
                             className={currentPage === p && s.active}>{p}</span>

            )}

        </div>
    )
}
export default Paginator
